Monster Exterminationfrom collections import deque

monsters_armor = deque(map(int, input().split(",")))
strike_impact = list(map(int, input().split(",")))

monsters_killed = 0


def success(soldiers, monsters):
    soldiers -= monsters
    if strike_impact:
        strike_impact[-1] += soldiers
    elif not strike_impact and soldiers > 0:
        strike_impact.append(soldiers)


def unsuccessful(monsters, soldiers):
    monsters -= soldiers
    monsters_armor.append(monsters)


def outcome():
    if not monsters_armor:
        return "All monsters have been killed!"
    if not strike_impact:   # it does not work completely in judge
        return "The soldier has been defeated."


def defeated_monsters():
    return f"Total monsters killed: {monsters_killed}"


while monsters_armor and strike_impact:
    monster = monsters_armor.popleft()
    soldier = strike_impact.pop()

    if soldier >= monster:
        monsters_killed += 1
        success(soldier, monster)
    else:
        unsuccessful(monster, soldier)

print(outcome())
print(defeated_monsters())

