const int MAXN = 26 * 100000 + 100;
const int N = 1e5 + 10;

struct vertex {
    int next[26];
    int terminal = 0;
} v[MAXN];

int root = 0, top = 1;
array<long long, MAXN> dp;

void add(const string& s) {
    int cur = root;
    for (auto& i: s) {
        int x = i - 'a';
        if (v[cur].next[x] == 0) {
            v[cur].next[x] = top++;
        }
        cur = v[cur].next[x];
        ++dp[cur];
    }
    v[cur].terminal = 1;
}

