    int n, m;
    cin >> n >> m;
    for (int i = 0; i < n; ++i) {
        string s;
        cin >> s;
        add(s);
    }
    for (int i = 0; i < m; ++i) {
        cin >> test;
        pos = 0;
        cout << (dfs(root, false) ? "YES\n" : "NO\n");
    }
}

